(()=>{const s=[];self.addEventListener("message",i=>{if(!i)return;const e=i.data;switch(e.type){case"CREATE_INTERVAL":{const r=e.timerId,n=e.response,a=setInterval(()=>self.postMessage(n),e.time);return void s.push({id:r,interval:a})}case"REMOVE_INTERVAL":{const r=e.timerId,t=0;for(;t<s.length;){const n=s[t];if(n.id===r)return clearInterval(n.interval),void s.splice(t,1)}}}})})();